import React, { useState, useEffect } from 'react';
import './RoverDetails.css';

function RoverDetails() {
  const [roverLogs, setRoverLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const API_BASE_URL = process.env.REACT_APP_API_BASE_URL || 'http://localhost:5000';

  useEffect(() => {
    const fetchRoverLogs = async () => {
      try {
        console.log('Fetching rover logs...');
        const response = await fetch(`${API_BASE_URL}/api/rover-logs`);
        if (!response.ok) {
          throw new Error(`Failed to fetch rover logs: ${response.statusText} (${response.status})`);
        }
        const data = await response.json();
        console.log('Data received:', data);
        setRoverLogs(data);
        setLoading(false);
      } catch (err) {
        console.error('Fetch error:', err);
        setError(err.message);
        setLoading(false);
      }
    };

    fetchRoverLogs();
  }, []);

  const handleRetry = () => {
    setError(null);
    setLoading(true);
    fetchRoverLogs();
  };

  if (loading) return <div className="rover-details-container">Loading...</div>;
  if (error) {
    return (
      <div className="rover-details-container">
        <h1>Error</h1>
        <p>{error}</p>
        <button
          onClick={handleRetry}
          style={{
            padding: '10px 20px',
            fontSize: '16px',
            cursor: 'pointer',
            backgroundColor: '#FFD700',
            border: 'none',
            borderRadius: '5px',
            marginTop: '1rem'
          }}
        >
          Retry
        </button>
      </div>
    );
  }
  if (roverLogs.length === 0) return <div className="rover-details-container">No rover logs available.</div>;

  return (
    <div className="rover-details-container">
      <h1>Rover Details</h1>
      <div className="rover-logs-grid">
        {roverLogs.map((log) => (
          <div key={log._id} className="rover-log-card">
            <h3>Rover ID: {log.rover_id}</h3>
            <p><strong>Timestamp:</strong> {new Date(log.timestamp).toLocaleString()}</p>
            <p><strong>Heading:</strong> {log.heading}Â°</p>
            <p><strong>Mode:</strong> {log.mode}</p>
            <p><strong>Armed:</strong> {log.armed ? 'Yes' : 'No'}</p>
            <p><strong>System Status:</strong> {log.system_status}</p>
            <p><strong>GPS:</strong> Lat: {log.gps?.latitude?.toFixed(6) || 'N/A'}, Lon: {log.gps?.longitude?.toFixed(6) || 'N/A'}</p>
            <p><strong>Battery:</strong> {log.battery?.voltage?.toFixed(2) || 'N/A'}V, {log.battery?.percentage?.toFixed(0) || 'N/A'}%</p>
            <p><strong>Velocity:</strong> {log.velocity?.speed?.toFixed(2) || 'N/A'} m/s</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default RoverDetails;
